import{_ as t,c as a,o,ag as s}from"./chunks/framework.Ds6Eueu6.js";const m=JSON.parse('{"title":"ALTER OPERATOR","description":"","frontmatter":{},"headers":[],"relativePath":"docs/7x/ref_guide/sql_commands/ALTER_OPERATOR.md","filePath":"docs/7x/ref_guide/sql_commands/ALTER_OPERATOR.md"}'),n={name:"docs/7x/ref_guide/sql_commands/ALTER_OPERATOR.md"};function i(r,e,p,l,c,d){return o(),a("div",null,e[0]||(e[0]=[s(`<h1 id="alter-operator" tabindex="-1">ALTER OPERATOR <a class="header-anchor" href="#alter-operator" aria-label="Permalink to &quot;ALTER OPERATOR&quot;">​</a></h1><p>Changes the definition of an operator.</p><h2 id="synopsis" tabindex="-1"><a id="section2"></a>Synopsis <a class="header-anchor" href="#synopsis" aria-label="Permalink to &quot;&lt;a id=&quot;section2&quot;&gt;&lt;/a&gt;Synopsis&quot;">​</a></h2><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>ALTER OPERATOR &lt;name&gt; ( {&lt;left_type&gt; | NONE} , {&lt;right_type&gt; | NONE} ) </span></span>
<span class="line"><span>   OWNER TO { &lt;new_owner&gt; | CURRENT_USER | SESSION_USER }</span></span>
<span class="line"><span></span></span>
<span class="line"><span>ALTER OPERATOR &lt;name&gt; ( {&lt;left_type&gt; | NONE} , {&lt;right_type&gt; | NONE} ) </span></span>
<span class="line"><span>    SET SCHEMA &lt;new_schema&gt;</span></span>
<span class="line"><span></span></span>
<span class="line"><span>ALTER OPERATOR name ( { &lt;left_type&gt; | NONE } , { &lt;right_type&gt; | NONE } )</span></span>
<span class="line"><span>    SET ( {  RESTRICT = { &lt;res_proc&gt; | NONE }</span></span>
<span class="line"><span>           | JOIN = { &lt;join_proc&gt; | NONE }</span></span>
<span class="line"><span>         } [, ... ] )</span></span></code></pre></div><h2 id="description" tabindex="-1"><a id="section3"></a>Description <a class="header-anchor" href="#description" aria-label="Permalink to &quot;&lt;a id=&quot;section3&quot;&gt;&lt;/a&gt;Description&quot;">​</a></h2><p><code>ALTER OPERATOR</code> changes the definition of an operator.</p><p>You must own the operator to use <code>ALTER OPERATOR</code>. To alter the owner, you must also be a direct or indirect member of the new owning role, and that role must have <code>CREATE</code> privilege on the operator&#39;s schema. (These restrictions enforce that altering the owner does not do anything you could not do by dropping and recreating the operator. However, a superuser can alter ownership of any operator anyway.)</p><h2 id="parameters" tabindex="-1"><a id="section4"></a>Parameters <a class="header-anchor" href="#parameters" aria-label="Permalink to &quot;&lt;a id=&quot;section4&quot;&gt;&lt;/a&gt;Parameters&quot;">​</a></h2><p>name : The name (optionally schema-qualified) of an existing operator.</p><p>left_type : The data type of the operator&#39;s left operand; write <code>NONE</code> if the operator has no left operand.</p><p>right_type : The data type of the operator&#39;s right operand; write <code>NONE</code> if the operator has no right operand.</p><p>new_owner : The new owner of the operator.</p><p>new_schema : The new schema for the operator.</p><p>res_proc : The restriction selectivity estimator function for this operator; write <code>NONE</code> to remove the existing selectivity estimator.</p><p>join_proc : The join selectivity estimator function for this operator; write <code>NONE</code> to remove the existing selectivity estimator.</p><h2 id="examples" tabindex="-1"><a id="section5"></a>Examples <a class="header-anchor" href="#examples" aria-label="Permalink to &quot;&lt;a id=&quot;section5&quot;&gt;&lt;/a&gt;Examples&quot;">​</a></h2><p>Change the owner of a custom operator <code>a @@ b</code> for type <code>text</code>:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>ALTER OPERATOR @@ (text, text) OWNER TO joe;</span></span></code></pre></div><p>Change the restriction and join selectivity estimator functions of a custom operator <code>a &amp;&amp; b</code> for type <code>int[]</code>:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>ALTER OPERATOR &amp;&amp; (_int4, _int4) SET (RESTRICT = _int_contsel, JOIN = _int_contjoinsel);</span></span></code></pre></div><h2 id="compatibility" tabindex="-1"><a id="section6"></a>Compatibility <a class="header-anchor" href="#compatibility" aria-label="Permalink to &quot;&lt;a id=&quot;section6&quot;&gt;&lt;/a&gt;Compatibility&quot;">​</a></h2><p>There is no <code>ALTER OPERATOR</code> statement in the SQL standard.</p><h2 id="see-also" tabindex="-1"><a id="section7"></a>See Also <a class="header-anchor" href="#see-also" aria-label="Permalink to &quot;&lt;a id=&quot;section7&quot;&gt;&lt;/a&gt;See Also&quot;">​</a></h2><p><a href="./CREATE_OPERATOR.html">CREATE OPERATOR</a>, <a href="./DROP_OPERATOR.html">DROP OPERATOR</a></p><p><strong>Parent topic:</strong> <a href="./../sql_commands/sql_ref.html">SQL Commands</a></p>`,25)]))}const R=t(n,[["render",i]]);export{m as __pageData,R as default};
